import React, { useEffect, useState } from 'react';
import { API_BASE_URL } from '../apiConfig';

interface DataRow {
  id_pers: number;
  name: string;
  firstname: string;
  subject: string;
  type: string;
  comment?: string;
  month: string;
  load: string; // Changed to string as the API might return a string
}

function AdminManageDebug() {
  const [data, setData] = useState<DataRow[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(`${API_BASE_URL}/api/data`);
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        const result = await response.json();
        setData(result);
      } catch (error) {
        if (error instanceof Error) {
          setError(error.message);
        } else {
          setError('An unknown error occurred');
        }
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <div>
      <h2>Debug Menu</h2>
      <h3>Data from API</h3>
      <table border="1" style={{ borderCollapse: 'collapse', width: '100%' }}>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Firstname</th>
            <th>Subject</th>
            <th>Type</th>
            <th>Comment</th>
            <th>Month</th>
            <th>Load</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, index) => (
            <tr key={index}>
              <td>{row.id_pers}</td>
              <td>{row.name}</td>
              <td>{row.firstname}</td>
              <td>{row.subject}</td>
              <td>{row.type}</td>
              <td>{row.comment || 'N/A'}</td>
              <td>{row.month}</td>
              <td>{row.load}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default AdminManageDebug;
